/* Trigger structure for table `netflix_user` */

DELIMITER $$

/*!50003 CREATE */ /*!50003 TRIGGER `is_sold_update` AFTER UPDATE ON `netflix_user` FOR EACH ROW BEGIN
       IF !(NEW.`stock_id` <=> OLD.`stock_id`) THEN 
       if NEW.`stock_id` !=0 then
		UPDATE `erp`.`netflix_stock` SET is_sold = 1 WHERE id = NEW.`stock_id` AND shared_acount = 0;
	else 
		UPDATE `erp`.`netflix_stock` SET is_sold = 0 WHERE id = OLD.`stock_id`AND shared_acount = 0 ;
	   END IF;
   END IF;
   
  
    END */$$


DELIMITER ;

