/* Event structure for event `inventory_update` */

DELIMITER $$

/*!50106 CREATE EVENT `inventory_update` ON SCHEDULE EVERY 1 DAY STARTS '2024-05-19 06:00:00' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
	call erp.`update_end_date`();
	
	END */$$
DELIMITER ;

/* Procedure structure for procedure `update_end_date` */

DELIMITER $$

/*!50003 CREATE PROCEDURE `update_end_date`()
BEGIN
	
	UPDATE `erp`.`netflix_stock` SET end_date = DATE_ADD(start_date, INTERVAL 30 DAY), day_left = DATEDIFF(end_date, CURRENT_DATE);
	UPDATE `erp`.`netflix_stock` SET  on_replace_day = DATEDIFF(CURRENT_DATE, `on_replace_time`);
	update `erp`.`netflix_stock` set is_sold = 0 where id in (select `stock_id` from `erp`.`netflix_user` WHERE day_left <= 0);
	UPDATE `erp`.`netflix_stock` SET active = 0, is_sold = 0 WHERE day_left <= 0;
	
	update `erp`.`netflix_user` set stock_id = 0, active = 0, Account_Status = 'Expired' where day_left <= 0;
	UPDATE `erp`.`netflix_user` SET active = 1, Account_Status = 'Safe' WHERE day_left > 0;
	UPDATE `erp`.`netflix_user` SET end_date = DATE_ADD(start_date, INTERVAL package*30 DAY), day_left = DATEDIFF(end_date, CURRENT_DATE);
	update `erp`.`netflix_user` set active=0 where stock_id = 0;
	update `erp`.`netflix_user` set active=1 where stock_id !=0;
	
	END */$$
DELIMITER ;

